import React from 'react';
import '../css/Header.css';

function Header() {
    return (
        <div className="Header">
            <div className="cute-globe"></div>
            <h1>NutriBoom</h1>
            <div className="cute-nutrition"></div>
        </div>
    );
}

export default Header;
